import React from 'react'


class PastDates extends React.Component {

  render(){
    let display;
     if (this.props.dates.length >= 0){
       display = <p>No Past Dates to Display</p>
     } else {
       display = <p>About to add</p>
     }
    return(
      <div>
      {display}
      </div>
    )
  }
}

export default PastDates
